private static AdvanceGroupStateResult cleanDuplicatedChanges(@NonNull AdvanceGroupStateResult groupStateResult,@Nullable DecryptedGroup previousGroupState){
  if (previousGroupState == null)   return groupStateResult;
  ArrayList<LocalGroupLogEntry> appliedChanges=new ArrayList<>(groupStateResult.getProcessedLogEntries().size());
